import './home.scss';

function Home() {
  return (
    <div id="home">
        <h1 className="heading">Note Together</h1>
        <h2>Upload your own video to enter a Youtube video link!</h2>
        <h2>Enter a title and upload!</h2>
        <h1>Upload</h1>
    </div>
  );
}

export default Home;
